import React from "react";
import styled from "styled-components";
import Product from "../Components/Product";

const Products = () => {
  return (
    <Wrap>
      <Product />
      <Product />
      <Product />
    </Wrap>
  );
};

const Wrap = styled.div`
  margin: 50px 20px;
  display: flex;
  gap: 5%;
`;

export default Products;
